Associated types are useful, but on their own they are often insufficient to capture the patterns we would like to write as a trait. Often, this occurs when the associated type wants to include data borrowed from self or some other parameter. The Iterator trait is great, but if you write a generic function that takes an Iterator, that iterator can only be iterated over a single time. Imagine a function that wanted to iterate once to find a total count and then again to process each item, this time knowing the full count: fn count_twice<I: Iterator>(iterator: I) { let mut count = 0; for _ in iterator { count += 1; } // Error: iterator already used for elem in iterator { process(elem, count); }
} Of course, most Rust types in the standard library have a method called iter that is exactly what we want (e.g., [T]::iter ). Given an &'i self, these functions return a fresh iterator that yields up &'i T references into the collection. Because they take a &self, they can be called as many times as we want. So, if we knew which kind of collection we had, we could easily write count_twice to take a [T] or a HashMap<T> or whatever. But what we if want to write it generically, so it works across any collection? That turns out to be impossible to do nicely with associated types. To see why, let's try to write the code and see where we get a stuck. We'll start by defining an Iterable trait: trait Iterable { // Type of item yielded up; will be a reference into `Self`. type Item; // Type of iterator we return. Will return `Self::Item` elements. type Iter: Iterator<Item = Self::Item>; fn iter<'c>(&'c self) -> Self::Iter;
} But when we try to write the impl, we run into a problem: impl<T> Iterable for [T] { type Item = &'hmm T; // ^^^^ what lifetime to use here? type Iter = Iter<'hmm, T>; // ^^^^ what lifetime to use here? fn iter<'c>(&'c self) -> Self::Iter { // ^^ THIS is the lifetime we want, but it's not in scope! Iter { data: self } }
} You see the problem? In the case of Iterator, the Self type was &'c [T] and the Item type was &'c T. Since both 'c and T appeared at the impl header level, both of those generic parameters were in scope and usable in the associated type. But for Iterable, we still want to yield references like &'c T, but 'c is not declared on the impl -- it's specific to the call to iter. The fact that the lifetime parameter 'c is declared on the method is not just a minor detail. It is exactly what allows something to be iterated many times; that is, the thing we are trying to capture with the Iterable trait. It means that the borrow you get when you call iter() only has to last as long as this specific call to iter. If you call iter multiple times, they can be instantiated with distinct borrows. (In contrast, if 'c were declared at the impl scope, the borrow would last across all calls to any method in Iterable.)

