Consider the typical "lending iterator" example. The idea here is to have an iterator that produces values that may have references into the iterator itself (as opposed to references into the collection being iterated over). In other words, given a next method like fn next<'a>(&'a mut self), the returned items have to be able to reference 'a. The typical Iterator trait cannot express that, but GATs can: trait LendingIterator { type Item<'a>; fn next<'b>(&'b mut self) -> Self::Item<'b>;
} Unfortunately, this trait definition turns out to be not quite right in practice. Consider an example like this, an iterator that yields a reference to the same item over and over again (note that it owns the item it is referencing): struct RefOnce<T> { my_data: T } impl<T> LendingIterator for RefOnce<T> { type Item<'a> where Self: 'a = &'a T; fn next<'b>(&'b mut self) -> Self::Item<'b> { &self.my_data }
} Here, the type type Item<'a> = &'a T declaration is actually illegal. Why is that? The assumption when authoring the trait was that 'a would always be the lifetime of the self reference in the next function, of course, but that is not in fact required . People can reference Item with any lifetime they want. For example, what if somebody wrote the type <SomeType<T> as LendingIterator>::Item<'static>? In this case, T: 'static would have to be true, but T may in fact contain borrowed references. This is why the compiler gives you a "T may not outlive 'a" error ( playground ). We can encode the constraint that "'a is meant to be the lifetime of the self reference" by adding a where Self: 'a clause to the type Item declaration. This is saying "you can only use a 'a that could be a reference to Self". If you make this change, you'll find that the code compiles ( playground ): trait LendingIterator { type Item<'a> where Self: 'a; fn next<'b>(&'b mut self) -> Self::Item<'b>;
}
